	private async Task<ExportedFile> ExportPowerBIReport(
		Guid reportId,
		Guid groupId,
		FileFormat format,
		int pollingtimeOutInMinutes,
		CancellationToken token,
		IList<string> pageNames = null,  /* Get the page names from the GetPages REST API */
		string urlFilter = null)
	{
		const int c_maxNumberOfRetries = 3; /* Can be set to any desired number */
		const int c_secToMillisec = 1000;
		try
		{
			Export export = null;
			int retryAttempt = 1;
			do
			{
				var exportId = await PostExportRequest(reportId, groupId, format, pageNames, urlFilter);
				var httpMessage = await PollExportRequest(reportId, groupId, exportId, pollingtimeOutInMinutes, token);
				_exportStatus = _exportStatus + 2;
				 StateHasChanged();
				export = httpMessage.Body;
				if (export == null)
				{
					// Error, failure in exporting the report
					return null;
				}
				if (export.Status == ExportState.Failed)
				{
					// Some failure cases indicate that the system is currently busy. The entire export operation can be retried after a certain delay
					// In such cases the recommended waiting time before retrying the entire export operation can be found in the RetryAfter header
					var retryAfter = httpMessage.Response.Headers.RetryAfter;
					if(retryAfter == null)
					{
						// Failed state with no RetryAfter header indicates that the export failed permanently
						return null;
					}

					var retryAfterInSec = retryAfter.Delta.Value.Seconds;
					await Task.Delay(retryAfterInSec * c_secToMillisec);
				}
			}
			while (export.Status != ExportState.Succeeded && retryAttempt++ < c_maxNumberOfRetries);

			if (export.Status != ExportState.Succeeded)
			{
				// Error, failure in exporting the report
				return null;
			}

			var exportedFile = await GetExportedFile(reportId, groupId, export);

			// Now you have the exported file stream ready to be used according to your specific needs
			// For example, saving the file can be done as follows:

			var pathOnDisk = @"C:\PowerBIReport\" + export.ReportName + exportedFile.FileSuffix;


			using (MemoryStream ms = new MemoryStream())
			{
				exportedFile.FileStream.CopyTo(ms);
				byte[] output = ms.ToArray();
				JSRuntime.InvokeVoidAsync("jsSaveAsFile",
				 export.ReportName+exportedFile.FileSuffix,
				 Convert.ToBase64String(output)
				 );
				ms.Close();
			}

			_exportStatus = 0;
			return exportedFile;
	}
	catch(Exception ex)
	{
		// Error handling
		throw;
	}
